import {
    USER_API_KEY,
    USER_SET_MEDIA_PREF
} from './user.types';
import { MEDIA } from '../../constants/media/media.constants';

export const setApiKey = key => ({
    type: USER_API_KEY.SET_KEY,
    payload: key
})

export const clearApiKey = () => ({
    type: USER_API_KEY.CLEAR_KEY,
    payload: ""
})

export const setMediaYoutube = () => ({
    type: USER_SET_MEDIA_PREF.YOUTUBE,
    payload: MEDIA.YOUTUBE
})

export const setMediaTwitter = () => ({
    type: USER_SET_MEDIA_PREF.TWITTER,
    payload: MEDIA.TWITTER
})

export const setMediaReddit = () => ({
    type: USER_SET_MEDIA_PREF.REDDIT,
    payload: MEDIA.REDDIT
})

export const setMediaAmazon = () => ({
    type: USER_SET_MEDIA_PREF.AMAZON,
    payload: MEDIA.AMAZON
})
